import React from 'react';
import ReactDOM from 'react-dom';
//import './index.css';
import './website.css';
//import App from './App';
import Websites from './components/websites';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(<App />, document.getElementById('root'));

